import React, { Component } from 'react';
import { Layout, Menu, Breadcrumb, Icon } from 'antd'
const { Header, Content, Footer, Sider } = Layout;
const { SubMenu } = Menu;
class LeftSide extends Component{
  render(){
    return (
      <Sider>
        <div>Side Header</div>
        <Menu.Item key='1'>
          Page1
        </Menu.Item>
        <Menu.Item key='2'>
          Page2
        </Menu.Item>
      </Sider>
    )
  }
}

export default LeftSide
